import { useEffect } from 'react';
import { useLocation } from 'react-router-dom';

function Delete() {
  const location = useLocation();

  useEffect(() => {
    if (location.state && location.state.data) {
      const { data } = location.state;
      // Haz algo con los datos
      console.log(data);
    }
  }, [location]);

 
}

export default Delete;
